import React from "react";
import {listDecks} from "../utils/api/index";



function Decks() {
    listDecks().map((deck) => {
        <p>{deck}</p>
    })
}

function Home() {
    return (
        <div>
            <Decks/>
        </div>
    )

}


export default Home;
